--

DROP TABLE IF EXISTS `url`;
CREATE TABLE `url` (
  `rec_id` int(11) NOT NULL auto_increment,
  `status` smallint(6) NOT NULL default '0',
  `docsize` int(11) NOT NULL default '0',
  `next_index_time` int(11) NOT NULL default '0',
